import styled from 'styled-components';

export const SidebarContent = styled.div`
  width: 305px;
`;

export const Title = styled.h2`
  margin-top: 10px;
`;

export const EmptyContent = styled.div`
  height: calc(100vh - 100px);

  display: flex;
  align-items: center;

  padding: 0px 10px;
`;
